import ExpenseItem from "./ExpenseItem";

const expenselist = (props) => {
  if (props.items.length() === 0) {
    return <p1>No content available</p1>;
  }
  return (
    <div>
      {props.items.map((item) => (
        <ExpenseItem
          key={item.id}
          title={item.title}
          amount={item.amount}
          date={item.date}
        ></ExpenseItem>
      ))}
    </div>
  );
};

export default expenselist;
